import React from "react";

const BotCollection = (bolts) => {

  return (
    <ul>
    <div className="ui four column grid">
      {bolts.map((bolt) => {
        return <li>bolt.name</li>;
      })}
      </div>
      </ul>
  );
};

export default BotCollection;
